const notes = [
    {
        key: 1,
        title: "Delegation",
        content:
            "How are you today ?"
    },
    {
        key: 2,
        title: "Loops",
        content:
            "Loops is "
    },
    {
        key: 3,
        title: "Arrays",
        content:
            "How are you today ?"
    }
];

export default notes;
